import React from 'react';
import { useCart } from '../context/CartContext';
import { Link } from 'react-router-dom';

const Cart = () => {
  const { cart, removeFromCart, updateQuantity, getTotalPrice, clearCart } = useCart();

  const handleBuyNow = () => {
    alert("MANOR The tea of Your Morning");
    clearCart();
  };

  return (
    <div className="min-h-screen bg-white text-black">
      <div className="max-w-7xl mx-auto px-4 py-12">
        <h1 className="text-4xl font-bold text-center mb-8">Your Tea Cart</h1>

        {cart.length === 0 ? (
          <div className="text-center py-20">
            <h2 className="text-2xl text-gray-400 mb-4">Your cart is empty</h2>
            <p className="text-gray-500 mb-8">Add some teas to get started</p>
            <Link 
              to="/products"
              className="bg-green-600 hover:bg-green-700 text-white px-6 py-3 rounded-lg font-bold"
            >
              Browse Teas
            </Link>
          </div>
        ) : (
          <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
            {/* Cart Items */}
            <div className="lg:col-span-2">
              <h2 className="text-2xl font-bold text-green-600 mb-6">Your Teas</h2>
              <div className="space-y-4">
                {cart.map((item, index) => (
                  <div key={index} className="bg-gray-100 border border-green-600 rounded-lg p-4 flex items-center justify-between">
                    <div className="flex items-center space-x-4">
                      <img 
                        src={item.image} 
                        alt={item.name}
                        className="w-16 h-16 object-cover rounded"
                        onError={(e) => {
                          e.target.src = `https://via.placeholder.com/64x64/1a1a1a/ff0000?text=${encodeURIComponent(item.name)}`;
                        }}
                      />
                      <div>
                        <h3 className="text-lg font-bold text-green-600">{item.name}</h3>
                        <p className="text-sm text-gray-600">{item.description}</p>
                      </div>
                    </div>
                    
                    <div className="flex items-center space-x-4">
                      <div className="flex items-center space-x-2">
                        <button 
                          onClick={() => updateQuantity(item.name, (item.quantity || 1) - 1)}
                          className="bg-gray-700 hover:bg-gray-600 text-white px-2 py-1 rounded"
                        >
                          -
                        </button>
                        <span className="text-black w-8 text-center">{item.quantity || 1}</span>
                        <button 
                          onClick={() => updateQuantity(item.name, (item.quantity || 1) + 1)}
                          className="bg-gray-700 hover:bg-gray-600 text-white px-2 py-1 rounded"
                        >
                          +
                        </button>
                      </div>
                      
                      <span className="text-xl font-bold text-green-600">
                        ${item.price.toFixed(2) * (item.quantity || 1)}
                      </span>
                      
                      <button 
                        onClick={() => removeFromCart(item.name)}
                        className="text-red-500 hover:text-red-400"
                      >
                        âœ•
                      </button>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            {/* Order Summary */}
            <div className="bg-gray-100 border border-green-600 rounded-lg p-6 h-fit">
              <h3 className="text-xl font-bold text-green-600 mb-4">Order Summary</h3>
              
              <div className="space-y-2 mb-4">
                <div className="flex justify-between">
                  <span className="text-gray-600">Total</span>
                  <span className="text-black">${getTotalPrice().toFixed(2)}</span>
                </div>
              </div>

              <button 
                onClick={handleBuyNow}
                className="w-full bg-green-600 hover:bg-green-700 text-white py-3 rounded-lg font-bold text-xl transform hover:scale-105 transition-all duration-200"
              >
                Buy Now
              </button>

              <button 
                onClick={clearCart}
                className="w-full mt-4 bg-gray-700 hover:bg-gray-600 text-white py-2 rounded-lg"
              >
                Clear Cart
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Cart;
